SELECT a.qdate,sum(a.tg_zhu_r) tg_zhu_r,sum(a.tg_sm_r) tg_sm_r,sum(a.tg_sc_r) tg_sc_r,sum(a.tg_xztz_r) tg_xztz_r,sum(a.tg_xztz_j) tg_xztz_j
from
(		# 推广注册详情
		SELECT DATE(a.time_h) qdate,count(DISTINCT(a.uid)) tg_zhu_r,0 tg_sm_r,0 tg_sc_r,0 tg_xztz_r,0 tg_xztz_j
		from 01u_0info a
		LEFT JOIN (SELECT uid from 01u_0info where mobile like "JM%") b on a.uid = b.uid      # 机密借款人注册
		where a.uid_kefu not in (145854,73170,73195,73721,112103,244848,276009,304525,1,181135,757996,910859)
		and a.uid not in (740,181,827,1008,1444,1451,1435,1452,6420,7127,11336,11350,11353,11871,12135,5528,18710,19104,19103,27632,6094,12668,14288)
		and b.uid is null  # 剔除机密借款人
    and a.tjr = ""
		and DATE(a.time_h) = DATE_SUB(curdate(),INTERVAL 1 DAY)
		GROUP BY DATE(a.time_h)
		UNION ALL
		# 推广实名详情
		SELECT DATE(a.update_time) qdate,0 tg_zhu_r,count(DISTINCT(a.uid)) tg_sm_r,0 tg_sc_r,0 tg_xztz_r,0 tg_xztz_j
		from rz_cg_user_ext a
		LEFT JOIN 01u_0info b on a.uid = b.uid
		where DATE(a.update_time) = DATE_SUB(curdate(),INTERVAL 1 DAY)
		and a.`status` = 1
		and a.is_authentication = 1
		and a.is_tied_card = 1
    and b.tjr = ""
		and b.uid_kefu not in (145854,73170,73195,73721,112103,244848,276009,304525,1,181135,757996,910859)
		and a.uid not in (740,181,827,1008,1444,1451,1435,1452,6420,7127,11336,11350,11353,11871,12135,5528,18710,19104,19103,27632,6094,12668,14288)
		GROUP BY DATE(a.update_time)
		UNION ALL
		# 推广首充详情
		SELECT  DATE(a.time_h) qdate,0 tg_zhu_r,0 tg_sm_r,count(DISTINCT(a.uid)) tg_sc_r,0 tg_xztz_r,0 tg_xztz_j
		from 04a_3applyqueue a
		LEFT JOIN 01u_0info b on a.uid=b.uid
		INNER JOIN (SELECT uid,min(time_h) min_time from 04a_3applyqueue where aptype = 7 and uid_ty = 1 and `status` = 3 GROUP BY uid) c on a.uid = c.uid and a.time_h = c.min_time
		where a.aptype = 7
		and a.uid_ty = 1
		and a.`status` = 3
    and b.tjr = ""
		and b.uid_kefu not in (145854,73170,73195,73721,112103,244848,276009,304525,1,181135,757996,910859)
		and a.uid not in (740,181,827,1008,1444,1451,1435,1452,6420,7127,11336,11350,11353,11871,12135,5528,18710,19104,19103,27632,6094,12668,14288)
		and DATE(a.time_h) = DATE_SUB(curdate(),INTERVAL 1 DAY)
		GROUP BY DATE(a.time_h)
		UNION ALL
		# 推广新增详情
		SELECT  DATE(a.time_h) qdate,0 tg_zhu_r,0 tg_sm_r,0 tg_sc_r,count(DISTINCT(a.uid)) tg_xztz_r,sum(a.account) tg_xztz_j
		from
		(
		SELECT uid,time_h,account
		from 05b_1tenderfinal
		where orguid=0 and bid <> 10000 and status in (1,3)
		and DATE(time_h) = DATE_SUB(curdate(),INTERVAL 1 DAY)
		UNION ALL
		SELECT user_id,add_time,real_amount
		from new_wd.borrow_tender
		where status = 1
		and DATE(add_time) = DATE_SUB(curdate(),INTERVAL 1 DAY)
		UNION ALL
		SELECT user_id,create_time,real_amount
		from new_wd.rz_borrow_tender
		where `status` = 1
		and DATE(create_time) = DATE_SUB(curdate(),INTERVAL 1 DAY)
		) a
		LEFT JOIN (
								SELECT h1.uid,ifnull(min(h1.time_h),0) min_time
								from
											(
												SELECT a1.uid,a1.account,a1.time_h
												from 05b_1tenderfinal a1
												LEFT JOIN 05b_0base t1 on a1.bid = t1.bid
												where a1.orguid = 0 and a1.bid <> 10000 and a1.status in (1,3)
												union all
												SELECT a2.user_id uid,a2.real_amount account,a2.add_time time_h
												from new_wd.borrow_tender a2
												where a2.status = 1
												union all
												select a3.user_id uid,a3.real_amount account,a3.create_time time_h
												from new_wd.rz_borrow_tender a3
												where a3.status = 1
											) h1
							 GROUP BY h1.uid
						 ) t on a.uid = t.uid
		LEFT JOIN 01u_0info b on a.uid = b.uid                   #b.tjr = ""则为非推荐人新增,b.tjr != "" 则为推荐人新增
